import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';

// Components
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import NotFound from './pages/NotFound';

// Create theme
const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
          <Navbar />
          <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
            <Routes>
              <Route path="/" element={<Navigate to="/login" replace />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/dashboard" element={<Dashboard />} />
              <Route path="*" element={<NotFound />} />
            </Routes>
          </Box>
        </Box>
      </Router>
    </ThemeProvider>
  );
}

export default App;

let authToken = null;

export async function register() {
  const username = document.getElementById('regUser').value;
  const password = document.getElementById('regPass').value;
  try {
    const response = await fetch('/api/register', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, password })
    });
    const result = await response.json();
    alert(result.message || result.error);
  } catch (error) {
    console.error('Registration error:', error);
  }
}

export async function login() {
  const username = document.getElementById('loginUser').value;
  const password = document.getElementById('loginPass').value;
  try {
    const response = await fetch('/api/login', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, password })
    });
    const result = await response.json();
    if (result.token) {
      authToken = result.token;
      document.getElementById('authSection').innerHTML = `
        <p>Welcome, ${username}!</p>
        <button onclick="logout()">Logout</button>
      `;
      document.getElementById('dashboard').classList.remove('hidden');
      document.getElementById('authForms').classList.add('hidden');
    } else {
      alert(result.error);
    }
  } catch (error) {
    console.error('Login error:', error);
  }
}

export function logout() {
  authToken = null;
  document.getElementById('dashboard').classList.add('hidden');
  document.getElementById('authForms').classList.remove('hidden');
  document.getElementById('authSection').innerHTML = '';
}

export async function encryptData() {
  const text = document.getElementById('encryptInput').value;
  try {
    const response = await fetch('/api/encrypt', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Authorization': `Bearer ${authToken}`
      },
      body: JSON.stringify({ data: text })
    });
    const result = await response.json();
    document.getElementById('encryptionResult').innerHTML = `
      <p>Encrypted successfully! File ID: ${result.fileId}</p>
    `;
  } catch (error) {
    console.error('Encryption error:', error);
  }
}

export async function analyzeThreats() {
  try {
    const response = await fetch('/api/threats', {
      headers: { 'Authorization': `Bearer ${authToken}` }
    });
    const result = await response.json();
    const threatDisplay = document.getElementById('threatDisplay');
    threatDisplay.innerHTML = `
      <h3>Risk Score: ${result.riskScore.toFixed(2)}%</h3>
      <p>Detected Threats:</p>
      <ul>${result.threatsDetected.map(t => `<li>${t}</li>`).join('')}</ul>
      <p>Recommendation: ${result.recommendation}</p>
    `;
  } catch (error) {
    console.error('Threat analysis error:', error);
  }
}
